import React, { useState, useEffect } from 'react';
import { View, Text, TextInput, FlatList, TouchableOpacity, StyleSheet } from 'react-native';

const initialPendingLoans = [
  {
    cid: '001',
    name: 'Justin Brown',
    status: 'Pending',
    date: 'June 10, 2025 11:30am',
    email: 'justin@example.com',
    number: '+639123456789',
    address: '123 Main St, Metro Manila',
    loan: {
      requested: '₱50,000',
      recommended: '₱100,000'
    }
  },
  {
    cid: '002',
    name: 'Lebron Black',
    status: 'Pending',
    date: 'June 11, 2025 10:30am',
    email: 'lebron@example.com',
    number: '+639234567890',
    address: '456 Oak St, Metro Manila',
    loan: {
      requested: '₱75,000',
      recommended: '₱150,000'
    }
  },
  {
    cid: '003',
    name: 'James White',
    status: 'Pending',
    date: 'June 12, 2025 9:15am',
    email: 'james@example.com',
    number: '+639345678901',
    address: '789 Pine St, Metro Manila',
    loan: {
      requested: '₱100,000',
      recommended: '₱200,000'
    }
  },
  {
    cid: '004',
    name: 'Monke de lufe',
    status: 'Pending',
    date: 'June 12, 2025 9:45am',
    email: 'monke@example.com',
    number: '+639456789012',
    address: '321 Cedar St, Metro Manila',
    loan: {
      requested: '₱60,000',
      recommended: '₱120,000'
    }
  },
];

export default function OpsPendingListScreen({ navigation, route }) {
  const [pendingLoans, setPendingLoans] = useState(initialPendingLoans);
  const [search, setSearch] = useState('');

  useEffect(() => {
    if (route.params?.updatedClient) {
      setPendingLoans(prevLoans =>
        prevLoans.map(loan =>
          loan.cid === route.params.updatedClient.cid
            ? { ...loan, status: route.params.updatedClient.status }
            : loan
        )
      );
      // Clear the route params to prevent re-updating
      navigation.setParams({ updatedClient: null });
    }
  }, [route.params?.updatedClient]);

  const filtered = pendingLoans.filter(
    item =>
      item.name.toLowerCase().includes(search.toLowerCase()) ||
      item.cid.includes(search)
  );

  const renderItem = ({ item }) => (
    <View style={styles.row}>
      <Text style={[styles.cell, { flex: 1 }]}>{item.cid}</Text>
      <Text style={[styles.cell, { flex: 3 }]}>{item.name}</Text>
      <Text style={[styles.cell, { flex: 2 },
        item.status === 'Approved' && styles.approvedStatus,
        item.status === 'Declined' && styles.declinedStatus
      ]}>
        {item.status}
      </Text>
      <Text style={[styles.cell, { flex: 3 }]}>{item.date}</Text>
      <TouchableOpacity
        style={styles.viewBtn}
        onPress={() => {
          navigation.navigate('OpsPendingLoanDetail', {
            client: item,
            backScreen: 'OpsPendingList'
          });
        }}

      >
        <Text>View</Text>
      </TouchableOpacity>
    </View>
  );

  return (
    <View style={styles.container}>
      {/* Header Row */}
      <View style={styles.headerRow}>
        <Text style={styles.title}>List of Pending Loan Approval</Text>
        <TouchableOpacity
          style={styles.dashboardBtn}
          onPress={() => navigation.navigate('OpsDashboard')}
        >
          <Text style={styles.btnText}>Go to Dashboard</Text>
        </TouchableOpacity>
      </View>

      {/* Search */}
      <View style={styles.searchBar}>
        <TextInput
          style={styles.searchInput}
          placeholder="Search"
          value={search}
          onChangeText={setSearch}
        />
      </View>

      {/* Table Header */}
      <View style={styles.tableHeader}>
        <Text style={[styles.headerCell, { flex: 1 }]}>CID</Text>
        <Text style={[styles.headerCell, { flex: 3 }]}>Full Name</Text>
        <Text style={[styles.headerCell, { flex: 2 }]}>Loan Status</Text>
        <Text style={[styles.headerCell, { flex: 3 }]}>Date Update</Text>
        <Text style={[styles.headerCell, { flex: 1 }]}></Text>
      </View>

      <FlatList
        data={filtered}
        keyExtractor={(item) => item.cid}
        renderItem={renderItem}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  approvedStatus: {
    color: '#2ecc71',
    fontWeight: 'bold',
  },
  declinedStatus: {
    color: '#e74c3c',
    fontWeight: 'bold',
  },
  container: {
    padding: 20,
    backgroundColor: '#f6f6f6',
    flex: 1,
  },
  headerRow: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 20,
  },
  title: {
    fontSize: 22,
    fontWeight: 'bold',
  },
  dashboardBtn: {
    backgroundColor: '#007bff',
    paddingVertical: 10,
    paddingHorizontal: 16,
    borderRadius: 6,
  },
  btnText: {
    color: '#fff',
    fontWeight: '600',
  },
  searchBar: {
    flexDirection: 'row',
    marginBottom: 10,
  },
  searchInput: {
    backgroundColor: '#ddd',
    borderRadius: 6,
    padding: 10,
    flex: 1,
  },
  tableHeader: {
    flexDirection: 'row',
    backgroundColor: '#dcdcdc',
    paddingVertical: 10,
    paddingHorizontal: 6,
    marginBottom: 4,
  },
  headerCell: {
    fontWeight: 'bold',
  },
  row: {
    flexDirection: 'row',
    paddingVertical: 12,
    borderBottomWidth: 1,
    borderColor: '#ccc',
    alignItems: 'center',
  },
  cell: {
    paddingHorizontal: 6,
  },
  viewBtn: {
    backgroundColor: '#ccc',
    paddingVertical: 6,
    paddingHorizontal: 16,
    borderRadius: 6,
  },
});
